import React from 'react';
import {BrowserRouter as Router , Route} from 'react-router-dom';
import App from './components/App';
import ServiceProviderHome from './components/ServiceProviderHome'
import UploadEmr from './components/UploadEmr'
import ShowPatientMrc from './components/ShowPatientMrc'
import Error from './components/Error'
import PatientHome from './components/PatientHome'

/**
 * All routes go here.
 * Don't forget to import the components above after adding new route.
 */
export default (
    <Router>
        <Route exact path="/" render={ props => <App {...props}/>}/>
        <Route path="/Error" render={ props => <Error {...props}/>}/> 
        <Route path='/PatientHome' render={ props => <PatientHome {...props}/>}/>
        <Route path="/ServiceProviderHome" render={ props => <ServiceProviderHome {...props}/>}/>
        <Route path="/UploadEmr" render={ props => <UploadEmr {...props}/>}/>   
        <Route path="/ShowPatientMrc" render={ props => <ShowPatientMrc {...props}/>}/>
        
    </Router>
);
